import {Fafacebook,Fainstagram,Falinkedin} from "react-icons/fa"
import { FaFacebook } from 'react-icons/fa';
import { Fains } from 'react-icons/fa';
import styles from "./Footer.module.css"
function Footer(){
  return (
  <footer>
   <li>
   <FaFacebook/>
   </li>
   <li>
   <Fainstagram/>
   </li>
   <li>
   <Falinkedin/>
   </li>
  </footer>
  )
}

export default Footer
